Here are some different approaches to listing files using ls using Deno.Command. The equivalent in bash would look like this: ls -la Example 1 (for Command) To do this using Deno.Command, I can do this (output bytes captured all at once, decoded to text): const output = await new Deno.Command("ls", { args: ["-la"] }).output();
console.log(new TextDecoder().decode(output.stdout)); Example 2 (for Command) Or this (output is streamed as text lines): for await ( const line of new Deno.Command("ls", { args: ["-la"], stdout: "piped" }) .spawn() .stdout .pipeThrough(new TextDecoderStream()) .pipeThrough(new TextLineStream())
) { console.log(line);
} This is really good compared to the old Deno.run which would leak resources if you didn't close the process and (multiple) readers explicitly. Error handling in child processes could also be tricky. In the new Deno.Command, all that is handled in a sensible way, automatically. This is already a giant leap forward for child process support in Deno. There is still a lot of boilerplate. We can do better.

