This is fine: run("ls", "-la"); This results in an error: A spread argument must either have a tuple type or be passed to a rest parameter. run(...["ls", "-la"]); What gives? Typescript needs a specific tuple type here, but assumes an array type instead. This is a Typescript thing, and I am sure they will get around to fixing it one day. Here is the longer version. The rest parameter passed to run is a tuple of type Cmd. The type signature is [string|URL, ...string[]]. Typescript assumes that ["ls", "-la"] is of type string[]. It is not able to figure out that string[] of guaranteed non-zero length is compatible with the tuple type Cmd. Until Typescript addresses this issue, the idiomatic fix is to simply specify the tuple type: run(...["ls", "-la"] as Cmd); This is a practical exmple of building up a command in piecemeal fashion: const cmd: Cmd = ["ls"];
cmd.push("-la");
run(...cmd);
